.btn-rounded {
  padding: 0.75rem 1.2rem;
  font-weight: 500;
  margin: 0;
  border: none;
  background-color: #fff;
  transition: all 0.5s ease-in;
}
.btn-rounded .btn__text {
  color: #4567B4;
  transition: all 0.5s ease-in;
}
.btn-rounded .btn__icon {
  color: #fff;
  background-color: #4567B4;
  width: 40px;
  height: 40px;
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  transition: all 0.5s ease-in;
}
.btn-rounded:hover {
  background: linear-gradient(to right, rgba(69, 103, 180, 0.95), rgba(86, 118, 191, 0.95));
  color: #fff;
  transition: all 0.5s ease-in;
}
.btn-rounded:hover .btn__text {
  color: #fff;
}
.btn-rounded:hover .btn__icon {
  color: #4567B4;
  background-color: #fff;
}

.btn--blue {
  background-color: #4567B4 !important;
}

.display-2 {
  margin-bottom: 1rem;
  text-transform: capitalize;
}
.display-2--intro {
  display: inline-block;
  font-weight: 700;
}
.display-2--description {
  font-size: 1.5rem;
  display: block;
  margin-top: 1.2rem;
  text-transform: none;
}

.heading-line::before {
  content: "";
  width: 10rem;
  height: 0.1rem;
  display: block;
  background-color: #4567B4;
  margin: 0 auto;
}

.heading-line::after {
  content: "";
  width: 2rem;
  padding-top: 0.5rem;
  height: 0.2rem;
  display: block;
  margin: 0 auto;
  background-color: #4567B4;
  margin-bottom: 1rem;
}

.display-3 {
  font-family: "Poppins", sans-serif;
}
.display-3--title {
  font-size: 2rem;
  text-transform: capitalize;
  font-weight: 600;
  font-family: "Poppins", sans-serif;
  display: inline-block;
  background-image: linear-gradient(to right, #4567B4, #103383);
  background-clip: text;
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
}

.gradient {
  background-image: linear-gradient(to right, rgba(69, 103, 180, 0.95), rgba(16, 51, 131, 0.95));
}

.bgPrimary {
  background: linear-gradient(to right, rgba(69, 103, 180, 0.95), rgba(86, 118, 191, 0.95));
}
.bgPrimary li {
  padding: 0 0.7rem;
}
.bgPrimary li a {
  color: #fff !important;
  text-transform: uppercase;
  font-weight: 600;
}

.intro-section {
  background: linear-gradient(to right, rgba(69, 103, 180, 0.95), rgba(86, 118, 191, 0.95));
  padding: 8rem 0 0 0;
  width: 100%;
  height: 100%;
}

.campanies {
  padding: 0 0 0.5 0;
}
.campanies__logo-box {
  max-width: 100%;
  height: 3rem;
  margin-bottom: 2rem;
  padding: 0 0.5rem;
  text-align: center;
  position: relative;
}
.campanies__logo-box img {
  height: 100%;
}
.campanies__logo-box img:hover {
  filter: grayscale(120);
}

.services {
  position: relative;
  padding: 1rem 0;
}
.services__content {
  padding: 1rem;
  margin-top: 7rem;
}
.services__content p {
  font-size: 0.8rem;
}
.services__content .icon {
  font-size: 2.5rem;
  color: #4567B4;
}
.services .btn--white {
  color: #fff;
}
.services__pic {
  max-width: 100%;
}

.testimonials {
  position: relative;
  padding: 0;
  background: linear-gradient(to right, rgba(69, 103, 180, 0.95), rgba(86, 118, 191, 0.95));
}
.testimonials__card {
  background-color: rgba(255, 255, 255, 0.8);
  padding: 2rem 1.25rem;
  border-radius: 0.625rem;
  height: auto;
  text-align: center;
}
.testimonials__card i {
  font-size: 1.5rem;
  color: rgba(69, 103, 180, 0.7);
}
.testimonials__card .ratings i {
  color: rgba(69, 103, 180, 0.7);
  font-size: 1rem;
}
.testimonials__picture {
  width: 6rem;
  height: 6rem;
  position: absolute;
  left: 50%;
  transform: translate(-50%, -50%);
}
.testimonials__picture img {
  border: 0.4rem solid rgba(69, 103, 180, 0.7);
}
.testimonials__name {
  padding-top: 4rem;
  margin-bottom: 2rem;
  text-align: center;
  font-weight: 500;
  color: #fff;
}
.testimonials__name h3, .testimonials__name .h3 {
  padding-top: 0.8rem;
  text-transform: capitalize;
}
.testimonials__name p {
  padding-bottom: 2rem;
  text-transform: capitalize;
}

.accordion .accordion-button:focus {
  outline: none;
  box-shadow: none;
}
.accordion .shadow {
  box-shadow: 0px 5px 10px rgba(0, 0, 0, 0.09) !important;
}

.portfolio {
  padding: 4rem 0;
}
.portfolio button {
  text-transform: capitalize;
}
.portfolio .btn-outline-primary {
  border: 1px solid #4567B4;
  color: #4567B4;
}
.portfolio .btn-outline-primary:hover {
  background-color: #103383;
  color: #fff;
}

.portfolio-box {
  position: relative;
  width: 100%;
  max-height: 18.56rem;
  overflow: hidden;
  margin-bottom: 1.2rem;
}
.portfolio-box img {
  width: 100%;
}
.portfolio-box .portfolio-info {
  background-color: rgba(69, 103, 180, 0.75);
  width: 100%;
  height: 100%;
  position: absolute;
  top: 0;
  opacity: 0;
  visibility: hidden;
}
.portfolio-box .portfolio-info .caption {
  text-align: center;
  color: #fff;
  margin-top: 6rem;
}
.portfolio-box .portfolio-info .caption h4, .portfolio-box .portfolio-info .caption .h4 {
  text-transform: uppercase;
}
.portfolio-box:hover .portfolio-info {
  opacity: 1;
  visibility: visible;
}

.get-started {
  padding: 4rem 0;
  background-color: #F4F4F4;
}

.cta-info {
  padding: 3rem;
  margin: 1rem 0;
}

.form .btn-primary {
  background-color: #4567B4 !important;
  border: none;
}

.footer {
  padding-top: 1rem;
  background-color: #151414;
}

.contact-box {
  position: relative;
}
.contact-box__icon {
  width: 4rem;
  stroke: #4567B4;
  padding-top: 0.2rem;
}
.contact-box__info {
  padding: 0.4rem;
  font-weight: 600;
}
.contact-box__info--title {
  color: #fff;
  text-decoration: none;
  font-size: 1.4rem;
}
.contact-box__info--subtitle {
  font-size: 1rem;
  color: #6C6C6C;
  text-decoration: none;
}

.footer-sm a {
  color: #fff;
}
.footer-sm a i {
  font-size: 2rem;
  margin-left: 1rem;
}

.campany-list {
  position: relative;
  display: block;
  list-style-type: none;
}
.campany-list li {
  margin-bottom: 0.5rem;
  text-decoration: none;
}
.campany-list li a {
  color: #fff;
  text-decoration: none;
}
.campany-list li a:hover {
  color: #4567B4;
}

.footer-bottom__copyright {
  color: #6C6C6C;
  font-weight: 400;
}
.footer-bottom__copyright a {
  color: #A7A4A4;
  text-decoration: none;
}
.footer-bottom__copyright a:hover {
  color: #4567B4;
  text-decoration: underline;
}

.back-to-top {
  position: fixed;
  width: 3rem;
  height: 3rem;
  right: 1.875rem;
  bottom: 1.875rem;
  z-index: 999;
  background-color: #4567B4 !important;
  display: flex;
  justify-content: center;
  align-items: center;
}
.back-to-top i {
  color: #fff;
  font-size: 1rem;
}

