sources.scss/_portfolio.scss:
.portfolio {
    padding: 4rem 0;

    button {
        text-transform: capitalize;
    }

    .btn-outline-primary {
        border: 1px solid $primary;
        color: $primary;

        &:hover {
            background-color: $secondary;
            color: $white;
        }
    }
}

.portfolio-box {
    position: relative;
    width: 100%;
    max-height: 18.56rem;
    overflow: hidden;
    margin-bottom: 1.2rem;

    img {
        width: 100%;
    }

    .portfolio-info {
        background-color: rgba($primary, 0.75);
        width: 100%;
        height: 100%;
        position: absolute;
        top: 0;
        opacity: 0;
        visibility: hidden;

        .caption {
            text-align: center;
            color: $white;
            margin-top: 6rem;

            h4 {
                text-transform: uppercase;
            }
        }
    }

    &:hover {
        .portfolio-info {
            opacity: 1;
            visibility: visible;
        }
    }
}

