sources.scss/_footer.scss:
.footer {
    padding-top: 1rem;
    background-color: $footer;
}

.contact-box {
    position: relative;

    &__icon {
       width: 4rem;
       stroke: $primary;
       padding-top: 0.2rem;
    }

    &__info {

        padding: 0.4rem;
        font-weight: 600;

        &--title {
          color: $white;
          text-decoration: none;
          font-size: 1.4rem;
        }

        &--subtitle{
          font-size: 1rem;
          color: #6C6C6C;
          text-decoration: none;
        }
    }
}

.footer-sm {

    a {
        color: $white;

        i {
            font-size: 2rem;
            margin-left: 1rem;
        }
    }
}

.campany-list {
    position: relative;
    display: block;
    list-style-type: none;

    li {
        margin-bottom: 0.5rem;
        text-decoration: none;

        a {
            color: $white;
            text-decoration: none;

            &:hover {
                color: $primary;
            }
        }
    }
}

.footer-bottom {

    &__copyright {
        color: #6C6C6C;
        font-weight: 400;

        a {
            color: #A7A4A4;
            text-decoration: none;

            &:hover {
                color: $primary;
                text-decoration: underline;
            }
        }
    }
}

.back-to-top {
    position: fixed;
    width: 3rem;
    height: 3rem;
    right: 1.875rem;
    bottom: 1.875rem;
    z-index: 999;
    background-color: $primary !important;
    display: flex;
    justify-content: center;
    align-items: center;

    i {
        color: $white;
        font-size: 1rem;
    }
}
